import React from 'react';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
import Button from '@mui/material/Button'
import { BrowserRouter as Router, Route, Link } from 'react-router-dom'; // Assuming you're using React Router for navigation

const CustomToolbar = () => {
  return (
    <div className='customToolbar'>
      <Toolbar sx={{ backgroundColor: '#333', color: 'white' }}>
        <IconButton size="large" edge="start" color="inherit" aria-label="menu">
          <MenuIcon />
        </IconButton>
        <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
          ABIT Solutions
        </Typography>

              {/* Text buttons with links */}
      <Button component={Link} to="/home" color="inherit">
        Home
      </Button>
      {/*<Button component={Link} to="/about" color="inherit">
        About
      </Button>*/}
        {/* Add more components or buttons as needed */}
      </Toolbar>
      <Route path="/home" exact component={CustomToolbar} />
    </div>
  );
};

export default CustomToolbar;
